import logo from './logo.svg';
import './App.css';
import DateTimePicker from 'react-datetime-picker'
import { useState } from 'react';

function showDate(date){
  return(
    <text>{date.getHours}</text>
  )
}

function showD(){
  return true;
}

function App() {
  const [value, onChange] = useState(new Date());
  let active = false;

  return (
    <div className="App">
      <DateTimePicker 
      onChange={onChange} 
      yearPlaceholder={"1999"} 
      monthPlaceholder={"04"} 
      dayPlaceholder={"21"} 
      hourPlaceholder={"00"} 
      minutePlaceholder={"00"} 
      secondPlaceholder={"00"}
    />
    {active ? <h1>{showDate(value)}</h1> : null }
    <button onClick={active = true}>show</button>
    </div>
  );
}

export default App;
